import React from 'react'
import "./ProductList.scss"
import Product from "../Product/Product"
const ProductList = ({products}) => {
  return (
    <div>
     {
       products.map((product)=>{
         let discountedPrice=(product.price)-(product.price * (product.discountedPrice/100));
         return (
           <Product key={product.id} product={{...product,discountedPrice}}></Product>
         )
       })
     }
    </div>
  )
}

export default ProductList
